description:
A (partial) set of presentations by Walter Veith while at Amazing Discoveries, recorded as streamed live from Langley, British Columbia, Canada.

(not recorded) Friday, October 4, 2013 - 6:30 pm &quot;Without Me You Can Do Nothing&quot;
Sabbath, October 5, 2013 - 11:00 am &quot;Rise &amp; Shine&quot;
Sabbath, October 5, 2013 - 2:00 pm &quot;The Herodian Mind - Part 1&quot;
Sabbath, October 5, 2013 - 4:00 pm &quot;The Herodian Mind - Part 2&quot;
(not recorded) Sabbath, October 5, 2013 - 6:15 pm &quot;I Think Therefore He Is&quot;

Topics covered include the symbols of power/control traced through time and their location in Jesuit, Masonic, government buildings and documents at all levels, and other places.  Activities of the white pope and black pope are mentioned.  Christian knowledge of the history of and relation to power is discussed.
